import React from "react";

const Posts = (props) => {
    const {posts} = props

    return (
        posts.map(post => {
            const {description, location, price, title} = post;
            return <div key={post.id}>
                    <h3>{title}</h3>
                    <p>{description}</p>
                    <p>Price:</p>
                    <p>Location: {location}</p>
                   </div>
        })
    )
}

export default Posts;
